import React from 'react'
import { Navbar, Container } from 'react-bootstrap'
const Header = (props) => {
    return (
            <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
                <Container >
                    <Navbar.Brand >To-Do App Mern Stack</Navbar.Brand>
                </Container>
            </Navbar>
    )
}

export default Header
